// --- HELPER FUNCTIONS ---

const calculateDistance = (lat1: number, lon1: number, lat2: number, lon2: number): number => {
  const R = 6371; // km
  const dLat = (lat2 - lat1) * Math.PI / 180;
  const dLon = (lon2 - lon1) * Math.PI / 180;
  const a = Math.sin(dLat / 2) * Math.sin(dLat / 2) +
    Math.cos(lat1 * Math.PI / 180) * Math.cos(lat2 * Math.PI / 180) *
    Math.sin(dLon / 2) * Math.sin(dLon / 2);
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
};

export const findNearestAirport = (lat: number, lon: number): Airport | null => {
  let nearest: Airport | null = null;
  let minDist = Infinity;

  // Filter Optimization: 1 deg lat ~ 111km.
  // We only care about airports within ~300km max.
  const MAX_DEG = 3.0;

  for (const port of AIRPORTS) {
    if (Math.abs(port.lat - lat) > MAX_DEG) continue;
    if (Math.abs(port.lon - lon) > MAX_DEG) continue;

    const dist = calculateDistance(lat, lon, port.lat, port.lon);
    if (dist < minDist) {
      minDist = dist;
      nearest = port;
    }
  }
  return nearest;
};
